pragma solidity >=0.4.21 <0.6.0;

contract GameOfLife {
  address public owner;
  //bytes1[100] the_game;
  uint8 [100] the_game;
  uint8 scale;

  constructor() public {
    owner = msg.sender;
    scale = 10;
    uint8 pseud_rand;
    for (uint i=0; i< the_game.length; i++) {
        pseud_rand = random();
        if (pseud_rand < 125){
            the_game[i] = 0;
        }
        else{
           the_game[i] = 1; 
        }
    }
  }

    function random() public view returns (uint8) {
       //return uint8(uint256(keccak256(block.timestamp, block.difficulty))%251);
       return  uint8(uint256(keccak256(abi.encodePacked(block.timestamp, block.difficulty)))%251);
   }

    function get_state() public view returns (uint8[100] memory) {
       //return uint8(uint256(keccak256(block.timestamp, block.difficulty))%251);
       return  the_game;
   }
}
